import { Col, Container, Row } from "react-bootstrap";

function App() {
  return (
    <Container fluid>
      <Row>
        <Col>Header</Col>
      </Row>
      <Row>
        <Col>Menu</Col>
      </Row>
      <Row>
        <Col>Banner</Col>
      </Row>
    </Container>
  );
}

export default App;
